css:
@-moz-document url-prefix("https://golang.org/"), url-prefix("https://blog.golang.org/") {
body {
    background: #282828;
    color: #ebdbb2;
}
.HomeSection-header {
    background: #282828;
    color: #ebdbb2;
}
#content .code, pre, h2, #sidebar, pre .ln {
    background: #353535;
}
.Playground-inputContainer, .Playground-input, .Playground-outputContainer, .Playground-output, .Playground-controls select, .Playground-controls button, .Button, .play, div.play .input, div.play .input textarea, div.play .output, div.play .output pre {
    background: #353535 !important;
    color: #ebdbb2 !important;
}
h1, h2, h3, h4, table th {
    color: #fe8019;
}
a, .exampleHeading .text, .expandAll {
    color: #d79921;
}
a:visited {
    color: #d65d0e;
}
.Header-menuItem, .Header-menuItem a:link, .Footer-links, .Footer-links a:link, #nav a {
    color: #b8bb26;
}
.Header-menuItem a:visited, .Footer-links a:visited, #nav a:visited, pre .comment {
    color: #98971a;
}
img.Footer-gopher, img.gopher, .Header-banner {
    display: none;
}
}

@-moz-document url-prefix("https://play.golang.org/") {
#wrap, #code, body {
    background: #282828;
    color: #ebdbb2;
}
#output, #output pre, input[type="button"], #importsBox, #banner > select {
    background: #353535 !important;
    border: 1px solid #ebdbb2;
    color: #ebdbb2 !important;
}
#banner, .lineerror {
    background: #353535;
    color: #fe8019 !important;
}
}
